USE `test_trade`;

CREATE TABLE `ksc_voucher_deduct` (
      `id` INT(11) NOT NULL AUTO_INCREMENT,
      `order_id` INT(11) NOT NULL COMMENT '订单ID',
      `voucher_no` VARCHAR(100) NOT NULL COMMENT '优惠券ID',
      `amount` DECIMAL(22,4) NOT NULL DEFAULT '0.0000' COMMENT '抵扣券金额',
      `before_deduct_amount` DECIMAL(22,4) NOT NULL DEFAULT '0.0000' COMMENT '订单抵扣券前金额',
      `after_deduct_amount` DECIMAL(22,4) NOT NULL DEFAULT '0.0000' COMMENT '订单抵扣券后金额',
      `create_time` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '开始时间',
      `update_time` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
      PRIMARY KEY (`id`)
) ENGINE=INNODB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `ksc_trade_order`;

